import React from 'react';
import sketingImg from '../sketing.jpg';
import paintingImg from '../sketching.jpg';
import travelingImg from '../traveling.jpg';

function Hobbies() {
  return (
    <section className="hobbies-collage">
      <div className="hobbies-grid">
        <img src={sketingImg} alt="" style={{ width: '500px', height: '700px', objectFit: 'cover' }} />
        <img src={paintingImg} alt="" style={{ marginTop: '300px', width: '400px', height: '400px', objectFit: 'cover' }} />
        <img src={travelingImg} alt="" style={{ width: '500px', height: '400px', objectFit: 'cover' }} />
      </div>
    </section>
  );
}

export default Hobbies;
